import { mapGetters } from 'vuex'
import production from './components/production'
import {getcitygarbageproductiondata} from '@/api/model'

export default {
  name: 'index',
  components: {
    production
  },
  data() {
    return {
      production_data: {
        production: {
          data: [],
          year: []
        }
      }
    }
  },
  computed: {
    ...mapGetters([
      'name'
    ])
  },
  mounted() {
    var that = this
    getcitygarbageproductiondata().then(res => {
      if (res.code === 20000) {
        console.log("res.data:",res)
        console.log("res.data:",res)
        let result = res.data
        result.sort(function(a, b) {
          return parseInt(a.year) > parseInt(b.year) ? 1 : -1
        })
        for (let i = 0; i < result.length; i++) {
          that.production_data.production.data.push(Math.round(parseFloat(result[i]['production'])*1.106327)/100)
          that.production_data.production.year.push(result[i]['year'])
        }
      }
    })
  }
}
